function loadPortfolio(t){var d="";if("older"===t)[...portfolio_item_list].forEach((t,i)=>{d+=getPortfolioCard(t)});else{var i=[...portfolio_item_list];(i=i.reverse()).forEach((t,i)=>{d+=getPortfolioCard(t)})}$(".portfolio-card").html(d),$(".portfolio-default").addClass("active-item")}function getPortfolioCard(t){var d="";return t.image.forEach((i,a)=>{d+='<img src="assets/img/project/'+t.image_folder+"/"+i+'" alt=""/>'}),'<div data-sort="'+t.sequence+'" class="portfolio-card-item filter '+t.filter_class+'"><div class="portfolio-card-item-slider"><div id="slider"><figure>'+d+'</figure></div></div><div class="portfolio-card-item-detail"><div class="about-profile"><table><tbody><tr><td><i class="fad fa-feather"></i> Title</td><td>'+t.title+'</td></tr><tr><td><i class="fad fa-user-gear"></i> Role</td><td>'+t.role+'</td></tr><tr><td><i class="fad fa-file-certificate"></i> Author</td><td>'+t.author+'</td></tr><tr><td><i class="fad fa-tags"></i> Category</td><td>'+t.category+'</td></tr><tr><td><i class="fad fa-calendar-days"></i> Year</td><td>'+t.year+'</td></tr><tr><td><i class="fad fa-link"></i> Link</td><td>'+t.link+'</td></tr><tr><td><i class="fad fa-message-lines"></i> Description</td><td>'+t.description+"</td></tr></tbody></table></div></div></div>"}console.log("%c>>> Loaded: Portfolio Container with Items","color: #27ae60; font-weight: bold;");